import React, { useState } from 'react';
import GymEquipment from './components/GymEquipment';
import WorkoutPlan from './components/WorkoutPlan';
import './App.css';

function App() {
  const [selectedEquipment, setSelectedEquipment] = useState([]);

  return (
    <div className="min-h-screen bg-gray-50">
      <div className="max-w-4xl mx-auto py-8 px-4">
        <header className="text-center mb-8">
          <h1 className="text-3xl font-bold text-gray-900">Workout Generator</h1>
          <p className="text-gray-600 mt-2">
            Select the equipment available at your gym to generate a personalized workout plan
          </p>
        </header>

        <div className="bg-white rounded-xl shadow-lg overflow-hidden">
          <GymEquipment
            selectedEquipment={selectedEquipment}
            setSelectedEquipment={setSelectedEquipment}
          />

          <div className="border-t border-gray-200">
            <WorkoutPlan selectedEquipment={selectedEquipment} />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
